B.a1g=s(["Preheat the oven to 180C/Gas 4. Prick the potato several times with a fork and bake for approximately 1 hour, or until soft inside.","Mix tuna with chilli, spring onion, cherry tomatoes and coriander.","Split the jacket potato and fill with the tuna mix and cottage cheese."],t.s)
B.a4g=s(["\u0633\u062e\u0651\u0646 \u0627\u0644\u0641\u0631\u0646 \u0639\u0644\u0649 180 \u062f\u0631\u062c\u0629. \u0627\u062b\u0642\u0628 \u0627\u0644\u0628\u0637\u0627\u0637\u0633 \u0639\u062f\u0629 \u0645\u0631\u0627\u062a \u0628\u0627\u0644\u0634\u0648\u0643\u0629 \u0648\u0627\u062e\u0628\u0632\u0647\u0627 \u0644\u0645\u062f\u0629 \u0633\u0627\u0639\u0629 \u062a\u0642\u0631\u064a\u0628\u0627\u064b \u062d\u062a\u0649 \u062a\u0644\u064a\u0646 \u0645\u0646 \u0627\u0644\u062f\u0627\u062e\u0644.","\u0627\u062e\u0644\u0637 \u0627\u0644\u062a\u0648\u0646\u0629 \u0645\u0639 \u0627\u0644\u0641\u0644\u0641\u0644 \u0627\u0644\u062d\u0627\u0631 \u0648\u0627\u0644\u0628\u0635\u0644 \u0627\u0644\u0623\u062e\u0636\u0631 \u0648\u0627\u0644\u0637\u0645\u0627\u0637\u0645 \u0627\u0644\u0643\u0631\u0632\u064a\u0629 \u0648\u0627\u0644\u0643\u0632\u0628\u0631\u0629.","\u0634\u0642\u0651 \u0627\u0644\u0628\u0637\u0627\u0637\u0633 \u0648\u0627\u062d\u0634\u0647\u0627 \u0628\u062e\u0644\u064a\u0637 \u0627\u0644\u062a\u0648\u0646\u0629 \u0648\u0627\u0644\u062c\u0628\u0646 \u0627\u0644\u0642\u0631\u064a\u0634."],t.s)
B.a8f=new A.c(B.ax,["Spicy tuna & cottage cheese jacket","For a low-fat energy lunch try a carbohydrate-heavy baked potato with a light and nutritious filling.",439,64,33,5,10,"Easy","Lunch",1,0,0,"BBC Good Food","https://images.immediate.co.uk/production/volatile/sites/30/2020/08/recipe-image-legacy-id-1201572_10-246be42.jpg","https://www.bbcgoodfood.com/recipes/spicy-tuna-cottage-cheese-jacket",B.a1g,"\u0628\u0637\u0627\u0637\u0633 \u0645\u0634\u0648\u064a\u0629 \u0628\u0627\u0644\u062a\u0648\u0646\u0629 \u0627\u0644\u062d\u0627\u0631\u0629 \u0648\u0627\u0644\u062c\u0628\u0646","\u0644\u063a\u062f\u0627\u0621 \u0642\u0644\u064a\u0644 \u0627\u0644\u062f\u0647\u0648\u0646 \u0648\u063a\u0646\u064a \u0628\u0627\u0644\u0637\u0627\u0642\u0629\u060c \u062c\u0631\u0651\u0628 \u0628\u0637\u0627\u0637\u0633 \u0645\u0634\u0648\u064a\u0629 \u0645\u0639 \u062d\u0634\u0648\u0629 \u062e\u0641\u064a\u0641\u0629 \u0648\u0645\u063a\u0630\u064a\u0629.",B.a4g],t.R)
B.a2l=s(["Slice chicken into bite-size pieces. Beat together egg white and cornflour in a bowl, tip in the chicken and coat. Marinate for 15-30 mins.","Rinse the rice, tip into a pan with water and a pinch of salt. Bring to the boil, cook uncovered for 10 mins, then cover and cook on lowest heat for 10 mins more.","Finely chop ginger, halve and chop the pepper, thinly slice shallot, garlic and chilli. Remove chicken from marinade and pat dry.","Heat a wok with oil. Cook the chicken for 7-10 mins, tossing until cooked. Set aside. Add pepper, then ginger, shallot and garlic.","Combine fish sauce, lime juice, water and cornflour. Tip into the wok with the chicken. Cook for 1 min, stir through basil, and serve with rice."],t.s)
B.a2b=s(["\u0642\u0637\u0651\u0639 \u0627\u0644\u062f\u062c\u0627\u062c \u0625\u0644\u0649 \u0642\u0637\u0639 \u0635\u063a\u064a\u0631\u0629. \u0627\u062e\u0641\u0642 \u0628\u064a\u0627\u0636 \u0627\u0644\u0628\u064a\u0636 \u0645\u0639 \u0646\u0634\u0627 \u0627\u0644\u0630\u0631\u0629\u060c \u0623\u0636\u0641 \u0627\u0644\u062f\u062c\u0627\u062c \u0648\u063a\u0644\u0651\u0641\u0647. \u0627\u062a\u0631\u0643\u0647 \u064a\u062a\u0628\u0651\u0644 \u0644\u0645\u062f\u0629 15-30 \u062f\u0642\u064a\u0642\u0629.","\u0627\u063a\u0633\u0644 \u0627\u0644\u0623\u0631\u0632 \u0648\u0636\u0639\u0647 \u0641\u064a \u0642\u062f\u0631 \u0645\u0639 \u0627\u0644\u0645\u0627\u0621 \u0648\u0631\u0634\u0629 \u0645\u0644\u062d. \u0627\u063a\u0644\u0650\u0647 \u0648\u0627\u0637\u0647\u0650\u0647 \u0645\u0643\u0634\u0648\u0641\u0627\u064b \u0644\u0645\u062f\u0629 10 \u062f\u0642\u0627\u0626\u0642\u060c \u062b\u0645 \u063a\u0637\u0651\u0647 \u0648\u0627\u0637\u0647\u0650\u0647 \u0639\u0644\u0649 \u0623\u0642\u0644 \u062d\u0631\u0627\u0631\u0629 \u0644\u0645\u062f\u0629 10 \u062f\u0642\u0627\u0626\u0642 \u0625\u0636\u0627\u0641\u064a\u0629.","\u0627\u0641\u0631\u0645 \u0627\u0644\u0632\u0646\u062c\u0628\u064a\u0644 \u0646\u0627\u0639\u0645\u0627\u064b\u060c \u0648\u0642\u0637\u0651\u0639 \u0627\u0644\u0641\u0644\u0641\u0644 \u0648\u0627\u0644\u0628\u0635\u0644 \u0648\u0627\u0644\u062b\u0648\u0645 \u0648\u0627\u0644\u0641\u0644\u0641\u0644 \u0627\u0644\u062d\u0627\u0631.","\u0633\u062e\u0651\u0646 \u0627\u0644\u0648\u0648\u0643 \u0645\u0639 \u0627\u0644\u0632\u064a\u062a. \u0627\u0637\u0647\u0650 \u0627\u0644\u062f\u062c\u0627\u062c \u0644\u0645\u062f\u0629 7-10 \u062f\u0642\u0627\u0626\u0642 \u0645\u0639 \u0627\u0644\u062a\u0642\u0644\u064a\u0628 \u062d\u062a\u0649 \u064a\u0646\u0636\u062c. \u0636\u0639\u0647 \u062c\u0627\u0646\u0628\u0627\u064b. \u0623\u0636\u0641 \u0627\u0644\u0641\u0644\u0641\u0644 \u062b\u0645 \u0627\u0644\u0632\u0646\u062c\u0628\u064a\u0644 \u0648\u0627\u0644\u0628\u0635\u0644 \u0648\u0627\u0644\u062b\u0648\u0645.","\u0627\u062e\u0644\u0637 \u0635\u0644\u0635\u0629 \u0627\u0644\u0633\u0645\u0643 \u0648\u0639\u0635\u064a\u0631 \u0627\u0644\u0644\u064a\u0645\u0648\u0646 \u0648\u0627\u0644\u0645\u0627\u0621 \u0648\u0646\u0634\u0627 \u0627\u0644\u0630\u0631\u0629. \u0627\u0633\u0643\u0628\u0647\u0627 \u0641\u064a \u0627\u0644\u0648\u0648\u0643 \u0645\u0639 \u0627\u0644\u062f\u062c\u0627\u062c. \u0627\u0637\u0647\u0650 \u0644\u0645\u062f\u0629 \u062f\u0642\u064a\u0642\u0629 \u0648\u0623\u0636\u0641 \u0627\u0644\u0631\u064a\u062d\u0627\u0646 \u0648\u0642\u062f\u0651\u0645 \u0645\u0639 \u0627\u0644\u0623\u0631\u0632."],t.s)
B.a8y=new A.c(B.ax,["Chicken stir-fry","Asian cooking can be light, healthy and so quick that you'll think twice before ever ordering a takeaway again!",501,42,76,5,15,"Easy","Dinner",4,0,1,"BBC Good Food","https://images.immediate.co.uk/production/volatile/sites/30/2020/08/recipe-image-legacy-id-52313_11-b424b72.jpg","https://www.bbcgoodfood.com/recipes/chicken-stir-fry-4-easy-steps",B.a2l,"\u062f\u062c\u0627\u062c \u0645\u0642\u0644\u064a \u0639\u0644\u0649 \u0627\u0644\u0637\u0631\u064a\u0642\u0629 \u0627\u0644\u0622\u0633\u064a\u0648\u064a\u0629","\u0627\u0644\u0637\u0628\u062e \u0627\u0644\u0622\u0633\u064a\u0648\u064a \u064a\u0645\u0643\u0646 \u0623\u0646 \u064a\u0643\u0648\u0646 \u062e\u0641\u064a\u0641\u0627\u064b \u0648\u0635\u062d\u064a\u0627\u064b \u0648\u0633\u0631\u064a\u0639\u0627\u064b \u062c\u062f\u0627\u064b!",B.a2b],t.R)
B.a6g=s(["Boil the eggs for 7 mins, then plunge into cold water. Heat oil in a frying pan, add mushrooms and cook for 8-10 mins until golden. Add rice, dill, lemon zest, juice and capers.","Line a baking sheet with parchment. Layer sheets of pastry, brushing with oil between layers. Butterfly the salmon by cutting through the side so you can open it like a book. Heat oven to 180C.","Place salmon on pastry and stuff with the rice mixture. Peel and slice the boiled eggs and arrange on the rice.","Close up the salmon, season and wrap with the pastry. Scrunch remaining pastry over the top, drizzle with oil and bake for 40 mins.","Serve with lemon wedges and dressed salad leaves."],t.s)
B.a3u=s(["\u0627\u0633\u0644\u0642 \u0627\u0644\u0628\u064a\u0636 \u0644\u0645\u062f\u0629 7 \u062f\u0642\u0627\u0626\u0642 \u062b\u0645 \u0636\u0639\u0647 \u0641\u064a \u0645\u0627\u0621 \u0628\u0627\u0631\u062f. \u0633\u062e\u0651\u0646 \u0627\u0644\u0632\u064a\u062a \u0648\u0627\u0637\u0647\u0650 \u0627\u0644\u0641\u0637\u0631 \u0644\u0645\u062f\u0629 8-10 \u062f\u0642\u0627\u0626\u0642. \u0623\u0636\u0641 \u0627\u0644\u0623\u0631\u0632 \u0648\u0627\u0644\u0634\u0628\u062a \u0648\u0628\u0631\u0634 \u0627\u0644\u0644\u064a\u0645\u0648\u0646 \u0648\u0627\u0644\u0639\u0635\u064a\u0631 \u0648\u0627\u0644\u0643\u0628\u0631.","\u0628\u0637\u0651\u0646 \u0635\u064a\u0646\u064a\u0629 \u0628\u0648\u0631\u0642 \u0627\u0644\u062e\u0628\u0632. \u0631\u062a\u0651\u0628 \u0637\u0628\u0642\u0627\u062a \u0627\u0644\u0639\u062c\u064a\u0646 \u0645\u0639 \u062f\u0647\u0646 \u0627\u0644\u0632\u064a\u062a \u0628\u064a\u0646\u0647\u0627. \u0627\u0641\u062a\u062d \u0627\u0644\u0633\u0644\u0645\u0648\u0646 \u0643\u0627\u0644\u0643\u062a\u0627\u0628. \u0633\u062e\u0651\u0646 \u0627\u0644\u0641\u0631\u0646 \u0639\u0644\u0649 180 \u062f\u0631\u062c\u0629.","\u0636\u0639 \u0627\u0644\u0633\u0644\u0645\u0648\u0646 \u0639\u0644\u0649 \u0627\u0644\u0639\u062c\u064a\u0646 \u0648\u0627\u062d\u0634\u0647 \u0628\u062e\u0644\u064a\u0637 \u0627\u0644\u0623\u0631\u0632. \u0642\u0634\u0651\u0631 \u0627\u0644\u0628\u064a\u0636 \u0648\u0642\u0637\u0651\u0639\u0647 \u0648\u0631\u062a\u0651\u0628\u0647 \u0639\u0644\u0649 \u0627\u0644\u0623\u0631\u0632.","\u0623\u063a\u0644\u0642 \u0627\u0644\u0633\u0644\u0645\u0648\u0646 \u0648\u062a\u0628\u0651\u0644\u0647 \u0648\u0644\u0641\u0651\u0647 \u0628\u0627\u0644\u0639\u062c\u064a\u0646. \u062c\u0639\u0651\u062f \u0628\u0627\u0642\u064a \u0627\u0644\u0639\u062c\u064a\u0646 \u0641\u0648\u0642\u0647 \u0648\u0631\u0634\u0651 \u0627\u0644\u0632\u064a\u062a \u0648\u0627\u062e\u0628\u0632\u0647 \u0644\u0645\u062f\u0629 40 \u062f\u0642\u064a\u0642\u0629.","\u0642\u062f\u0651\u0645\u0647 \u0645\u0639 \u0634\u0631\u0627\u0626\u062d \u0627\u0644\u0644\u064a\u0645\u0648\u0646 \u0648\u0623\u0648\u0631\u0627\u0642 \u0627\u0644\u0633\u0644\u0637\u0629."],t.s)
B.a8m=new A.c(B.ax,["Easy salmon coulibiac","This dish of pastry-wrapped rice and fish is easy but impressive so it works well as a midweek meal or dinner party centrepiece.",477,29,34,25,20,"Easy","Dinner",6,0,0,"BBC Good Food","https://images.immediate.co.uk/production/volatile/sites/30/2020/08/easy-salmon-coulibiac-f42a130.jpg","https://www.bbcgoodfood.com/recipes/easy-salmon-coulibiac",B.a6g,"\u0643\u0648\u0644\u064a\u0628\u064a\u0627\u0643 \u0627\u0644\u0633\u0644\u0645\u0648\u0646 \u0627\u0644\u0633\u0647\u0644","\u0637\u0628\u0642 \u0645\u0646 \u0627\u0644\u0633\u0645\u0643 \u0648\u0627\u0644\u0623\u0631\u0632 \u0645\u0644\u0641\u0648\u0641 \u0628\u0627\u0644\u0639\u062c\u064a\u0646\u060c \u0633\u0647\u0644 \u0644\u0643\u0646\u0647 \u0645\u0628\u0647\u0631 \u0648\u064a\u0635\u0644\u062d \u0643\u0648\u062c\u0628\u0629 \u0639\u0634\u0627\u0621 \u0623\u0646\u064a\u0642\u0629.",B.a3u],t.R)
B.a4C=s(["Chop 1 large onion into small dice. Cut 1 red pepper in half, remove stalk and seeds, then chop. Peel and finely chop 2 garlic cloves.","Heat oil in a pan over medium heat. Add the onion and cook for about 5 minutes until soft and translucent.","Tip in the garlic, red pepper, chilli powder, paprika and ground cumin. Stir and cook for another 5 minutes.","Turn the heat up, add 500g lean mince and break it up. Cook for at least 5 minutes until browned with no pink bits.","Crumble a stock cube into 300ml hot water and pour into the pan. Add chopped tomatoes, marjoram, sugar, salt, pepper and tomato puree. Stir well.","Bring to the boil, put a lid on and simmer gently for 20 minutes, stirring occasionally.","Drain and rinse kidney beans, stir into the chilli. Bring to the boil and simmer without the lid for 10 minutes.","Season to taste, replace the lid, turn off the heat and leave for 10 minutes. Serve with soured cream and rice."],t.s)
B.a5M=s(["\u0642\u0637\u0651\u0639 \u0628\u0635\u0644\u0629 \u0643\u0628\u064a\u0631\u0629 \u0645\u0643\u0639\u0628\u0627\u062a \u0635\u063a\u064a\u0631\u0629. \u0642\u0637\u0651\u0639 \u0627\u0644\u0641\u0644\u0641\u0644 \u0627\u0644\u0623\u062d\u0645\u0631 \u0628\u0639\u062f \u0625\u0632\u0627\u0644\u0629 \u0627\u0644\u0628\u0630\u0648\u0631. \u0642\u0634\u0651\u0631 \u0648\u0627\u0641\u0631\u0645 \u0641\u0635\u0651\u064a\u0646 \u062b\u0648\u0645.","\u0633\u062e\u0651\u0646 \u0627\u0644\u0632\u064a\u062a \u0641\u064a \u0642\u062f\u0631 \u0639\u0644\u0649 \u0646\u0627\u0631 \u0645\u062a\u0648\u0633\u0637\u0629. \u0623\u0636\u0641 \u0627\u0644\u0628\u0635\u0644 \u0648\u0627\u0637\u0647\u0650 \u0644\u0645\u062f\u0629 5 \u062f\u0642\u0627\u0626\u0642 \u062d\u062a\u0649 \u064a\u0635\u0628\u062d \u0637\u0631\u064a\u0627\u064b.","\u0623\u0636\u0641 \u0627\u0644\u062b\u0648\u0645 \u0648\u0627\u0644\u0641\u0644\u0641\u0644 \u0627\u0644\u0623\u062d\u0645\u0631 \u0648\u0645\u0633\u062d\u0648\u0642 \u0627\u0644\u0641\u0644\u0641\u0644 \u0627\u0644\u062d\u0627\u0631 \u0648\u0627\u0644\u0628\u0627\u0628\u0631\u064a\u0643\u0627 \u0648\u0627\u0644\u0643\u0645\u0648\u0646. \u062d\u0631\u0651\u0643 \u0648\u0627\u0637\u0647\u0650 \u0644\u0645\u062f\u0629 5 \u062f\u0642\u0627\u0626\u0642 \u0623\u062e\u0631\u0649.","\u0627\u0631\u0641\u0639 \u0627\u0644\u062d\u0631\u0627\u0631\u0629 \u0648\u0623\u0636\u0641 \u0627\u0644\u0644\u062d\u0645 \u0627\u0644\u0645\u0641\u0631\u0648\u0645 \u0648\u0641\u062a\u0651\u062a\u0647. \u0627\u0637\u0647\u0650 \u0644\u0645\u062f\u0629 5 \u062f\u0642\u0627\u0626\u0642 \u0639\u0644\u0649 \u0627\u0644\u0623\u0642\u0644 \u062d\u062a\u0649 \u064a\u062d\u0645\u0631\u0651.","\u0623\u0630\u0628 \u0645\u0643\u0639\u0628 \u0627\u0644\u0645\u0631\u0642 \u0641\u064a 300 \u0645\u0644 \u0645\u0627\u0621 \u0633\u0627\u062e\u0646 \u0648\u0627\u0633\u0643\u0628\u0647. \u0623\u0636\u0641 \u0627\u0644\u0637\u0645\u0627\u0637\u0645 \u0627\u0644\u0645\u0641\u0631\u0648\u0645\u0629 \u0648\u0627\u0644\u0628\u0647\u0627\u0631\u0627\u062a \u0648\u0627\u0644\u0633\u0643\u0631 \u0648\u0645\u0639\u062c\u0648\u0646 \u0627\u0644\u0637\u0645\u0627\u0637\u0645. \u062d\u0631\u0651\u0643 \u062c\u064a\u062f\u0627\u064b.","\u0627\u063a\u0644\u0650\u0647 \u062b\u0645 \u063a\u0637\u0651\u0647 \u0648\u0627\u062a\u0631\u0643\u0647 \u064a\u064f\u0637\u0647\u0649 \u0639\u0644\u0649 \u0646\u0627\u0631 \u0647\u0627\u062f\u0626\u0629 \u0644\u0645\u062f\u0629 20 \u062f\u0642\u064a\u0642\u0629 \u0645\u0639 \u0627\u0644\u062a\u062d\u0631\u064a\u0643 \u0623\u062d\u064a\u0627\u0646\u0627\u064b.","\u0635\u0641\u0651 \u0648\u0627\u063a\u0633\u0644 \u0627\u0644\u0641\u0627\u0635\u0648\u0644\u064a\u0627 \u0648\u0623\u0636\u0641\u0647\u0627. \u0627\u063a\u0644\u0650 \u0648\u0627\u062a\u0631\u0643\u0647 \u0628\u062f\u0648\u0646 \u063a\u0637\u0627\u0621 \u0644\u0645\u062f\u0629 10 \u062f\u0642\u0627\u0626\u0642.","\u062a\u0628\u0651\u0644 \u062d\u0633\u0628 \u0627\u0644\u0630\u0648\u0642\u060c \u063a\u0637\u0651 \u0648\u0623\u0637\u0641\u0626 \u0627\u0644\u0646\u0627\u0631 \u0648\u0627\u062a\u0631\u0643\u0647 10 \u062f\u0642\u0627\u0626\u0642. \u0642\u062f\u0651\u0645 \u0645\u0639 \u0627\u0644\u0643\u0631\u064a\u0645\u0629 \u0627\u0644\u062d\u0627\u0645\u0636\u0629 \u0648\u0627\u0644\u0623\u0631\u0632."],t.s)
